import React from "react";
import "./App.css";
import Card from './Componentes/Card'
import Primera from './Componentes/primera.jpg'


function App() {
  const imagenes = [
    {
      img: Primera,
      title: "LUNES",
      subtitle: "Powerful Women",
      color: "#CC3366",
      texto1:
        "Abdominales",
        texto1:
        "Cuadriceps",
        texto2:
        "Viceps"
    }
  ];
  return (
    <div>
      {imagenes.map(card => {
        return (
          <Card
            title={card.title}
            color={card.color}
            img={card.img}
            texto1={card.texto1}
            texto2={card.texto2}
          ></Card>
        ); 
      })}
    </div>
  );
}

export default App;
